import React, { Component } from 'react';
import './Table.css';
import { withRouter } from 'react-router-dom';
class Table extends React.Component {
    render() {
        const items = this.props.items;
        return (
            <div >
                <table id="customers">
                    <tbody>
                        <tr>
                            <th>ID</th>
                            <th>Username</th>
                            <th>Phone</th>
                            <th>StartDate</th>
                            <th>EndDate</th>
                            <th>Action</th>

                        </tr>
                        {items.map((item,index) => {
                            return (
                                <tr>
                                    <td contenteditable="true"> {item.id.bind(this,index)}</td>
                                    <td contenteditable="true">{item.username.bind(this,index)}</td>

                                    <td contenteditable="true">{item.phone.bind(this,index)}</td>
                                    <td contenteditable="true">{item.startDate.bind(this,index)}</td>
                                    <td contenteditable="true">{item.endDate.bind(this,index)}</td>
                                    <td contenteditable="false">{item.action.bind(this,index)}
                                    <button onClick={this.props.handelDelete.bind(null,index)}>Delete</button>
                                   
                                    </td>
                                    
                                </tr>
                            );
                        })}
                    </tbody>
                </table>
            </div>
        );
    }
}

export default withRouter(Table) ;
